a></strong>.</p>\n<input name="form_charset" type="hidden" value="UTF-8">\n</form></div>\n</div>\n<div id="maincontent">\n<div id="welcomebox"><div class="welcomeLeft"><h1>The world’s most-loved way to pay and get paid. <a href="https://personal.paypal.com/cgi-bin/marketingweb?cmd=_render-content&amp;content_ID=marketing_us/How_does_PayPal_work">Learn More</a>\n</h1></div></div>\n<div class="t1mpi"><div class="MktMPI" id="mpi600005"><a class="heroimage" href="https://personal.paypal.com/cgi-bin/marketingweb?cmd=_render-content&amp;content_ID=marketing_us/How_To_Use_PayPal"><img src="https://www.paypalobjects.com/WEBSCR-630-20100506-1/en_US/Marketing/i/scr/scr_cpr_home_heroimage_542x228.jpg" border="0" alt=""></a></div></div>\n<div id="payments">\n<div class="firstbox">\n<h3>Pay Online</h3>\n<p>Shop and pay online quickly and securely.</p>\n<p class="learnMoreArrow"><a href="https://personal.paypal.com/us/cgi-bin/?&amp;cmd=_render-content&amp;content_ID=marketing_us/pay_online">Learn More</a></p>\n</div>\n<div class="secondbox">\n<h3>Send Money</h3>\n<p>Send money to anyone with an email address.</p>\n<p class="learnMoreArrow"><a href="https://www.paypal.com/sendmoney">Learn More</a></p>\n</div>\n<div class="thirdbox">\n<h3>Get Paid</h3>\n<p>Accept online payments for items you sell.</p>\n<p class="learnMoreArrow"><a href="https://personal.paypal.com/us/cgi-bin/?&amp;cmd=_render-content&amp;content_ID=marketing_us/receive_money">Learn More</a></p>\n</div>\n<img src="https://www.paypalobjects.com/WEBSCR-630-20100506-1/en_US/Marketing/i/scr/scr_cpr_graydots_547x1.gif" border="0" class="dottedline" alt=""><p class="acceptCredit">Looking to accept credit cards or set up a merchant account? Visit <a href="https://www.paypal.com/merchants">Merchant Services</a></p>\n</div>\n</div>\n<div id="bgleftgradient">\n<div class="leftHeader"><h3>Get to Know PayPal</h3></div>\n<div id="leftBody"><ul>\n<li><a href="https://personal.paypal.com/cgi-bin/marketingweb?cmd=_render-content&a